ATTRIBUTE.VALUE:
UPDATE RPT FROM $$SLSORDVWDB.MT_SALES_MOTION_RPT RPT, $$COMREFVWDB.R_PRODUCTS PRDT , $$SLSORDVWDB.N_BKGS_MEASURE BKGS SET ORDERED_ITEM=PRDT.BK_PRODUCT_ID , EDW_UPDATE_DTM =CURRENT_TIMESTAMP(0) WHERE BKGS.DV_PRODUCT_KEY=PRDT.ITEM_KEY AND RPT.BOOKINGS_MEASURE_KEY =BKGS.BOOKINGS_MEASURE_KEY AND RPT.BOOKINGS_PROCESS_DATE=BKGS.BOOKINGS_PROCESS_DATE AND RPT.BKGS_MEASURE_TRANS_TYPE_CODE=BKGS.BKGS_MEASURE_TRANS_TYPE_CODE AND RPT.BKGS_MEASURE_TRANS_TYPE_CODE= 'SLS_ADJ' AND RPT.ORDERED_ITEM='UNKNOWN' ;
UPDATE RPT FROM $$SLSORDVWDB.MT_SALES_MOTION_RPT RPT, $$COMREFVWDB.R_PRODUCTS PRDT , (SELECT SK_SALES_MOTION_ATTRIB_KEY,DV_ENTERPRISE_INV_SKU_ID,END_TV_DTM from $$SLSORDVWDB.MT_BKG_SLS_MOTION_ATTRIBUTION where END_TV_DTM > CURRENT_TIMESTAMP(0) group by 1,2,3) RTR SET ENTERPRISE_SKU=PRDT.SK_INVENTORY_ITEM_ID_INT , EDW_UPDATE_DTM =CURRENT_TIMESTAMP(0) WHERE RTR.DV_ENTERPRISE_INV_SKU_ID=PRDT.ITEM_KEY AND RPT.SK_SALES_MOTION_ATTRIB_KEY=RTR.SK_SALES_MOTION_ATTRIB_KEY AND RPT.RTR_SRC_ENTERPRISE_INV_SKU_ID=RTR.DV_ENTERPRISE_INV_SKU_ID AND RTR.END_TV_DTM > CURRENT_TIMESTAMP(0) AND RPT.BKGS_MEASURE_TRANS_TYPE_CODE= 'SLS_ADJ' AND RPT.ENTERPRISE_SKU =-999;
--- Notify RTR_OFFER_TYPE used for General offer type logic value UPDATE RPT FROM $$SLSORDVWDB.MT_SALES_MOTION_RPT RPT, ( SELECT RPT.BOOKINGS_MEASURE_KEY,RPT.BOOKINGS_PROCESS_DATE,RPT.BK_SERVICE_CATEGORY_ID, CASE WHEN ST.BK_SERVICE_CATEGORY_ID IN 'COMBINED SERVICES' THEN 'COMBINED SERVICES' WHEN RPT.BK_ALLOCATED_SERVC_GROUP_ID IN 'FOCUSED TECHNICAL SUPPORT SERVICES' THEN 'FTSS' WHEN RPT.FINANCE_BU_SW_TYPE = 'SWSS' THEN 'SWSS' WHEN RPT.BK_ALLOCATED_SERVC_GROUP_ID IN ('CLOUD MANAGED SERVICES') THEN 'CMS' WHEN ( RPT.BK_ALLOCATED_SERVC_GROUP_ID IN 'AS SUBSCRIPTION' AND RPT.RU_BK_SERVICE_PROD_SUBGROUP_ID NOT LIKE 'NC%' ) THEN 'AS-S' WHEN ( RPT.BK_ALLOCATED_SERVC_GROUP_ID IN ('AS TRANSACTION','TRAINING','AS FIXED') AND RPT.RU_BK_SERVICE_PROD_SUBGROUP_ID NOT LIKE 'NC%' ) THEN RPT.BK_ALLOCATED_SERVC_GROUP_ID WHEN TTS.SALES_ORDER_LINE_KEY IS NOT NULL THEN 'TSS' ELSE 'OTHERS' END OFFER_TYPE FROM $$SLSORDVWDB.MT_SALES_MOTION_RPT RPT INNER JOIN (SELECT BOOKINGS_MEASURE_KEY,BOOKINGS_PROCESS_DATE,DV_PRODUCT_KEY FROM $$SLSORDVWDB.N_BKGS_MEASURE WHERE BKGS_MEASURE_TRANS_TYPE_CODE = 'SLS_ADJ' GROUP BY 1,2,3) BKGS ON BKGS.BOOKINGS_MEASURE_KEY=RPT.BOOKINGS_MEASURE_KEY AND BKGS.BOOKINGS_PROCESS_DATE=RPT.BOOKINGS_PROCESS_DATE INNER JOIN $$STGDB.WI_SFH_RUP ST ON ST.ITEM_KEY = BKGS.DV_PRODUCT_KEY LEFT JOIN $$STGDB.WI_TTS_SOWB_SOL_LINES TTS ON RPT.DV_SALES_ORDER_LINE_KEY = TTS.SALES_ORDER_LINE_KEY WHERE RPT.BKGS_MEASURE_TRANS_TYPE_CODE= 'SLS_ADJ' GROUP BY 1,2,3,4 ) OFFER SET SMR_OFFER_TYPE=OFFER.OFFER_TYPE , EDW_UPDATE_DTM =CURRENT_TIMESTAMP(0) WHERE RPT.BOOKINGS_MEASURE_KEY=OFFER.BOOKINGS_MEASURE_KEY AND RPT.BOOKINGS_PROCESS_DATE=OFFER.BOOKINGS_PROCESS_DATE AND RPT.BK_SERVICE_CATEGORY_ID=OFFER.BK_SERVICE_CATEGORY_ID AND RPT.BKGS_MEASURE_TRANS_TYPE_CODE = 'SLS_ADJ' AND RPT.SMR_OFFER_TYPE ='UNKNOWN';
CALL COLLECT_STATS_WRAP ('$$SLSORDDB','MT_SALES_MOTION_RPT','D') ;
